INSERT INTO `activeinfo` VALUES ('34', '1', '虚拟现实技术应用', '霍利岭', '<div class=\"para-title level-2\" label-module=\"para-title\" style=\"clear: both; zoom: 1; overflow: hidden; border-left-width: 12px; border-left-style: solid; border-left-color: rgb(79, 156, 238); line-height: 24px; font-size: 22px; font-family: \'Microsoft YaHei\', SimHei, Verdana; margin: 35px 0px 15px -30px; position: relative; color: rgb(51, 51, 51); background-image: url(https://bkssl.bdimg.com/static/wiki-lemma/normal/resource/img/paraTitle-line_c5e6d61.png); background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><h2 class=\"title-text\" style=\"margin: 0px; padding: 0px 8px 0px 18px; font-size: 22px; color: rgb(0, 0, 0); float: left; line-height: 24px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">简介</h2></div><div class=\"para\" label-module=\"para\" style=\"font-size: 14px; word-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif;\">虚拟现实技术是仿真技术的一个重要方向，是仿真技术与计算机图形学人机接口技术多媒体技术传感技术网络技术等多种技术的集合，是一门富有挑战性的交叉技术前沿学科和研究领域。虚拟现实技术(VR)主要包括模拟环境、感知、自然技能和传感设备等方面。模拟环境是由计算机生成的、实时动态的三维立体逼真图像。感知是指理想的VR应该具有一切人所具有的感知。除计算机图形技术所生成的视觉感知外，还有听觉、触觉、力觉、运动等感知，甚至还包括嗅觉和味觉等，也称为多感知。自然技能是指人的头部转动，眼睛、手势、或其他人体行为动作，由计算机来处理与参与者的动作相适应的数据，并对用户的输入作出实时响应，并分别反馈到用户的五官。传感设备是指三维交互设备。</div><div class=\"anchor-list\" style=\"position: relative; color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 12px; line-height: 18px;\"><a name=\"2\" class=\"lemma-anchor para-title\" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a name=\"sub7299_2\" class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a name=\"发展历史\" class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a></div><div class=\"para-title level-2\" label-module=\"para-title\" style=\"clear: both; zoom: 1; overflow: hidden; border-left-width: 12px; border-left-style: solid; border-left-color: rgb(79, 156, 238); line-height: 24px; font-size: 22px; font-family: \'Microsoft YaHei\', SimHei, Verdana; margin: 35px 0px 15px -30px; position: relative; color: rgb(51, 51, 51); background-image: url(https://bkssl.bdimg.com/static/wiki-lemma/normal/resource/img/paraTitle-line_c5e6d61.png); background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><h2 class=\"title-text\" style=\"margin: 0px; padding: 0px 8px 0px 18px; font-size: 22px; color: rgb(0, 0, 0); float: left; line-height: 24px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">发展历史</h2></div><div class=\"para\" label-module=\"para\" style=\"font-size: 14px; word-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif;\">虚拟现实技术演变发展史大体上可以分为四个阶段：有声形动态的模拟是蕴涵虚拟现实思想的第一阶段（1963年以前）；虚拟现实萌芽为第二阶段（1963 -1972 ）；虚拟现实概念的产生和理论初步形成为第三阶段（1973 -1989 ）；虚拟现实理论进一步的完善和应用为第四阶段（1990 -2004 ）。</div>', '/uploads/20190127/6523d94fa4075b735c8841959e5b15b8.gif', '1-212', '2', '2019-02-16 07:40:00.000000', '50', '0', 'hll', '', '1');
