INSERT INTO `activeinfo` VALUES ('50', '7', '2019朋辈学堂主题1——平面设计', '李佳航', '<p><b>每周四14:00-15:50  共八周</b></p><p>1、PS的安装和基本界面说明</p><p>2、工具栏的使用</p><p>3、图层的样式</p><p>4、图层蒙板和快速蒙版</p><p>5、色彩原理和图层的混合模式</p><p>6、文字的应用</p><p>7、滤镜的使用</p><p>面向对象：2018级专业不限</p>', '/uploads/20190318/bc53e52b1c686ab785afbdcf8ec1c777.jpg', '526机房', '2', '2019-03-21 14:00:00.000000', '60', '1', 'huoll', '', '1.6');
INSERT INTO `activeinfo` VALUES ('51', '7', '2019朋辈学堂主题2——微信小程序', '刘禹含 程中华 许海波', '<p><b>每周四下午 14:00-15:50  物联网实验室 共八周</b></p><p>1、初识小程序—小程序的介绍，下载安装以及基本操作</p><p>2、了解小程序专用标签语言WXML，WXSS</p><p>3、常用组件学习</p><p>4、开发实例讲解</p><p>5、自己实操，制作简易小程序</p><p><b>面向学生：16、17级计算机类</b></p>', '/uploads/20190318/1416fec1ba722333bf3a5120ded79455.jpg', '第三实验楼      四楼物联网实验室', '2', '2019-03-21 14:00:00.000000', '20', '1', 'huoll', '', '1.6');
INSERT INTO `activeinfo` VALUES ('52', '7', '2019同辈课堂主题3——Unity 游戏开发', '常子安 郭元鹏', '<p></p><div><b><span style=\"font-size: 14px;\">每周四下午 14:00-15:50 共八周</span></b></div><div><span style=\"font-size: 14px;\">0、 游戏行业的介绍</span></div><div><span style=\"font-size: 14px;\">1、 游戏编程的相关知识</span></div><div><span style=\"font-size: 14px;\">2、 unity的安装与介绍</span></div><div><span style=\"font-size: 14px;\">3、 五大视图的功能介绍</span></div><div><span style=\"font-size: 14px;\">4、 c#的相关应用</span></div><div><span style=\"font-size: 14px;\">5、 粒子系统、动画系统的相关内容</span></div><div><span style=\"font-size: 14px;\">6、 第一款小游戏的开发（见缝插针）</span></div><div><span style=\"font-size: 14px;\">7、 第二款下游戏的开发（坦克大战）</span></div><div><span style=\"font-size: 14px;\"><b>面向学生：17级、18级计算机、网络</b></span></div>', '/uploads/20190318/a1a52ec8dcedccbfe48f7fd54a7cf5c2.jpg', '514机房', '2', '2019-03-21 14:00:00.000000', '60', '1', 'huoll', '', '1.6');
INSERT INTO `activeinfo` VALUES ('53', '7', '2019朋辈学堂主题4——网页前端架构', '赵大宝 郭元鹏', '<p>每周四下午14:00-15:50  516机房</p><p>1、web前端就业前景及框架分析</p><p>2、框架设计及代码规范</p><p>3、网站填充（轮播和3D盒子）</p><p>4、表单设计应用（JS）</p><p>5、验证码获取设计（JS）</p><p>6、淘宝倒计时教学（JS）</p><p>面向学生：17计算机、网络</p>', '/uploads/20190319/14e740130ba2532cd39ac9a4790a188a.jpg', '516机房', '2', '2019-03-21 14:00:00.000000', '60', '1', 'huoll', '', '1.6');
INSERT INTO `activeinfo` VALUES ('54', '7', '2019朋辈学堂主题5——HTML+CSS页面设计', '崔一航', '<p>每周四下午14:00-15:50 共八周</p><p>1、了解webstorm操作界面，并学会安装和使用webstorm。</p><p>2、web前端基础了解。</p><p>3、html语言风格及其各标签和属性的使用。</p><p>4、css样式设计学习及美化网页界面。</p><p>5、实操：简单网页制作。</p><p>6、最终答疑，并完成结课作业。</p><p>面向学生17、18级非计算机类</p>', '/uploads/20190319/c1f302d10f1e790263c1f558e740ac36.jpg', '第三实验楼 网络实验室', '2', '2019-03-21 14:00:00.000000', '40', '1', 'huoll', '17、18级非计算机类', '1.6');
INSERT INTO `activeinfo` VALUES ('55', '7', '2019朋辈学堂主题6——CSS动画', '任晨', '<p><b>每周四19:00—20:50  共八次</b></p><p>1.定位   2D  3D  转换  过渡  动画  </p><p>2.js鼠标事件</p><p>3.实例演示</p><p><b>面向学生：17级计算机、17网络</b></p>', '/uploads/20190319/5b949330aee53e186dca090d8e7d5db1.jpg', '第三实验楼 网络实验室', '2', '2019-03-21 19:00:00.000000', '40', '1', 'huoll', '', '1.6');
